import React from 'react';
import {Route, Redirect} from 'react-router-dom';

export function IsUserRedirect({user, loggerInPath, childre, ...rest}){
    return (
        <Route
            {...rest}
            render = {() => {
                if (!user){
                    return children;
                }
                if (user) {
                    return (
                        <Redirect
                            to= {{
                                pathname: loggedInPath,
                            }}
                        />
                    );
                }
                return null;
            }}
        />
    );
}
